import React, { Component } from 'react'

class SortColumn extends Component {

    handleTitleClick = (event) => {
        this.props.handleTitleClick(event.target.value)
    }

    render(){
        return (
            <tr>
            <th onClick={this.handleTitleClick}>Title</th>
            <th onClick={this.handleTitleClick}>Album</th>
            <th onClick={this.handleTitleClick}>Artist</th>
            <th onClick={this.handleTitleClick}>Genre</th>
            </tr>
        )
    }
}

export default SortColumn
